tables.table_schema:
CREATE TABLE network_configuration (
  id INT PRIMARY KEY,
  network_name VARCHAR(255),
  equipment_type VARCHAR(255),
  frequency_band VARCHAR(50)
);

CREATE TABLE network_configuration (
  id INT PRIMARY KEY,
  network_name VARCHAR(255),
  frequency_band VARCHAR(50),
  bandwidth DECIMAL
);

CREATE TABLE network_sites (
  site_id UUID PRIMARY KEY,
  site_name VARCHAR(255) NOT NULL,
  site_location VARCHAR(255) NOT NULL,
  deployment_date DATE
);

CREATE TABLE network_antennas (
  antenna_id UUID PRIMARY KEY,
  cell_id UUID REFERENCES network_cells(cell_id),
  antenna_type VARCHAR(50) NOT NULL,
  frequency_range VARCHAR(50) NOT NULL
);

CREATE TABLE network_equipment (
  equipment_id UUID PRIMARY KEY,
  antenna_id UUID REFERENCES network_antennas(antenna_id),
  equipment_name VARCHAR(100) NOT NULL,
  equipment_type VARCHAR(50) NOT NULL
);

CREATE TABLE Equipment (
   equipment_id INT PRIMARY KEY,
   equipment_type VARCHAR(50),
   vendor_name VARCHAR(100),
   equipment_status VARCHAR(50)
);

CREATE TABLE Users (
   user_id INT PRIMARY KEY,
   user_name VARCHAR(255),
   user_type VARCHAR(50),
   user_email VARCHAR(100)
);
